const pricing = ["Pricing Tier 1", "Pricing Tier 2", "Pricing Tier 3", "Pricing Tier 4", "Pricing Tier 5", "Pricing Tier 6"];

const footerContainer = document.getElementById("footer");


function createFooterColumn(title, items) {
  const column = document.createElement("div");
column.classList.add("footer-column");

  const columnTitle = document.createElement("h4");
    columnTitle.classList.add("footer-title");
  columnTitle.textContent = title;
  column.appendChild(columnTitle);

  items.forEach(item => {
    const link = document.createElement("a");
  link.classList.add("footer-link");
    
       link.textContent = item;
    column.appendChild(link);
  });

  return column;
}

// Now build footer columns
footerContainer.appendChild(createFooterColumn("Site Map", sideMap));
footerContainer.appendChild(createFooterColumn("Services", services));
footerContainer.appendChild(createFooterColumn("Products", products));
footerContainer.appendChild(createFooterColumn("Support", support));
footerContainer.appendChild(createFooterColumn("Legal", legal));
footerContainer.appendChild(createFooterColumn("Pricing", pricing));
